  browserHistory.push("/orders");

  let isUser = false

  if (localStorage.getItem("token")) {
    isUser = true
  }

  function UserGreeting(){
    return (
      <div>
      Main
    </div>
  )
  }

  function GuestGreeting() {
    return (
      <div>
      Main
    </div>
  )
  }

  if (isUser) {
    return UserGreeting()
  }
  else {
    return GuestGreeting()
  }
};
export default Main;
